import styled from "@emotion/styled";

export const WriteTimeContainer = styled.div`
  display: flex;
  font-family: Pretendard;
  width: 100%;
`;

export const WriteContainer = styled.div`
  padding-left: 6vw;
  padding-top: 5rem;
`;

export const WriteTimeFont = styled.div`
  font-size: 3vw;
`;

export const WriteTimeBox = styled.div`
  margin: 2rem 0rem -1rem 0rem;
  width: 30vw;
  height: 6rem;
  background-color: #d9d9d9;
  border-radius: 1.5rem;
`;

export const WriteTodayBox = styled.div`
  margin: 2rem 0rem -1rem 0rem;
  width: 30vw;
  height: 45rem;
  background-color: #d9d9d9;
  border-radius: 1.5rem;
`;

export const TodayContainer = styled.div`
  padding-left: 12vw;
  padding-top: 5rem;
`;
